import './App.css';
import Link from './Components/Link';
import ApplicantLogin from './Pages/ApplicantLogin';
import ConfirmExam from './Pages/ConfirmExam';
import Route from './Components/Route';
import { useDispatch } from 'react-redux';
import { loadPath, changePath, LOGIN_PATH, CONFIRM_PATH, QUESTIONS_PATH } from './store';
import { useEffect } from 'react';

function App() {

  const dispatch = useDispatch();
  useEffect(() =>
  {
    Start();

    const handler = (event) =>
    {
      dispatch(changePath(window.location.pathname));
    }
    window.addEventListener('popstate', handler);
    return () =>
    {
        window.removeEventListener('popstate', handler)
    }
  }, []);

  const Start = ()=>
  {
    dispatch(loadPath(LOGIN_PATH));
  }

  return (
    <div className="">
      <header className="App-header">
        <h1>Interview Hub</h1>
      </header>
      <Route path={LOGIN_PATH}>
        <ApplicantLogin/></Route>
      <Route path={CONFIRM_PATH}>
        <ConfirmExam/></Route>
    </div> 
  );
}

export default App;
